import React, { useState, useEffect } from 'react';
import './css/home.css'

// Images
import sliderBg from '../image/slider_bg.jpg'; // Adjusted path as per common practice

import snowpark from '../image/snowpark-home-slide-decoration-bottomm.png';
import star from '../image/5star.png';


import aws from '../image/scope-india-aws-certification-course-(1).jpg';
import cloud from '../image/scope-india-azure-certification-course.jpg';
import digitalmarketing from '../image/scope-india-digital-marketing-course.jpg';
import dotnet from '../image/scope-india-dotnet-core-full-stack-course.jpg';
import flutter from '../image/scope-india-flutter-fullstack-course.jpg';
import java from '../image/scope-india-java-full-stack-course (1).jpg';
import mern from '../image/scope-india-mean-mern-stack-course.jpg';
import network from '../image/scope-india-network-server-administration-course (1).jpg';
import php from '../image/scope-india-php-full-stack-course (1).jpg';
import python from '../image/scope-india-python-full-stack-course (1).jpg';
import software from '../image/scope-india-software-testing-manual-automation-course.jpg';
import software2 from '../image/scope-india-software-testing-manual-automation-course.jpg';

// Components
import ContactForm from './Contactform';
import Homenavigate from './Homenavigate';
import Footer from './Footer';

const Home = () => {
  const [currentImage, setCurrentImage] = useState(0);
  const images = [ aws, cloud, digitalmarketing, dotnet, flutter,  java, mern, network, php, python, software, software2];

  useEffect(() => {
    const timer = setTimeout(() => {
      setCurrentImage((currentImage + 3) % images.length);
    }, 4000);

    return () => clearTimeout(timer); // Cleanup on component unmount
  }, [currentImage]);

  return (
    <>
      <div className={styles.heroSection}>
        <img src="/path/to/slider_bg.jpg" alt="Hero background" className={styles.heroBackground} />
        <div className={styles.centerContent}>
          {/* Logo and other elements */}
        </div>
        <div className={styles.slideContainer}>
          {images.slice(currentImage, currentImage + 3).map((image, index) => (
            <div key={index} className={`${styles.slideItem} ${index === 1 ? styles.specialSlide : ''}`}>
              <img src={image} alt={`Slide ${index}`} className={styles.slideImage} />
            </div>
          ))}
        </div>
        <img src="/path/to/snowpark_decoration.png" alt="Snowpark Decoration" className={styles.snowparkDecor} />
      </div>

      {/* Testimonial Section */}
      <div className={styles.testimonialSection}>
        <div className={styles.testimonialContent}>
          <img src="/path/to/star.png" alt="Star rating" className={styles.starImage} />
          <p className={styles.testimonialText}>Google 4.9 * Rated Institute</p>
          <h1 className={styles.testimonialText}>SCOPE INDIA, your career partner!</h1>
          <h2 className={styles.testimonialText}>One of the best Training Destination for Software, Networking and Cloud Computing courses in India with 17 years of Industrial experience.</h2>
          <p className={styles.testimonialText}>We offer a wide range of professional education courses tailored to meet the needs of working professionals seeking to enhance their skills and advance in their careers.</p>
        </div>
      </div>

      {/* Contact Form Section */}
      <div className={styles.contactFormSection}>
        <div className={styles.contentContainer}>
          {/* Placeholder for ContactForm component */}
          <div>Contact us through our contact form for any inquiries or to schedule a consultation.</div>
        </div>
      </div>

      {/* Navigation */}
      <div className={styles.navigationFooter}>
        <div className={styles.contentContainer}>
          {/* Placeholder for Homenavigate component */}
          <nav>
            <ul>
              <li><a href="/">Home</a></li>
              <li><a href="/about">About Us</a></li>
              <li><a href="/courses">Courses</a></li>
              <li><a href="/contact">Contact</a></li>
            </ul>
          </nav>
        </div>
      </div>

      {/* Footer */}
      <div className={styles.navigationFooter}>
        <div className={styles.contentContainer}>
          {/* Placeholder for Footer component */}
          <footer>
            © 2023 Scope India. All rights reserved.
          </footer>
        </div>
      </div>
    </>
  );
};

export default Home;
